import classes from './InstructorBar.module.css';
import seema from './profSeema.jpeg'


const InstructorBar=()=>{

return (

<div className={classes.instructorBar}>

   <i> Instructor:  
	<button>  <img className={classes.instructorImage} src={seema} alt='edr Logo' /> Prof. Seema Bahinipati  </button> 
   </i>


   <i>  Course status: <b  className={classes.cStatus}> Ongoing</b> </i>	

</div>

);

}

export default InstructorBar;
